import React from 'react'
import { FaInstagram } from "react-icons/fa";
import { FaFacebook } from "react-icons/fa";
import { FaTwitter } from "react-icons/fa";

export default function Footer() {
  return (
    <footer>
    <h2>All ruts are protected</h2>
    <div>
        <a href="https://www.facebook.com/KrispyKreme?locale=ru_RU" target="_blank" rel="noreferrer" ><FaFacebook /></a>
        <a href="https://twitter.com/krispykreme" target="_blank" rel="noreferrer"><FaTwitter /></a>
        <a href="https://www.instagram.com/krispykreme/" target="_blank" rel="noreferrer"><FaInstagram /></a>
        </div>
    </footer>
  )
}
